        inputElement.addEventListener('keydown', function(event) {

        function searchHanja() {
            const total = 110850;
            const inputElement = document.getElementById('inputString');
            const searchString = inputElement.value;
            const resultElement = document.getElementById('result');
            let found = false;

            if (/^[A-Za-z]+$/.test(searchString)) {
                for (let count = 0; count < total; count++) {
                    if (searchString === tuplechanghil[count] && !found) {
                        resultElement.innerHTML = '<div>倉頡碼\t漢字\t來源</div>';
                        resultElement.innerHTML += searchString + '\t' + tuplehanja[count] + '\t' + tuplesource[count] + '<br>';
                        found = true;
                    } else if (searchString === tuplechanghil[count]) {
                        resultElement.innerHTML += searchString + '\t' + tuplehanja[count] + '\t' + tuplesource[count] + '<br>';
                        found = true;
                    } else if (count === total - 1 && !found) {
                        resultElement.innerHTML = '<div>查無此碼</div>';
                    }
                }
            } else {
                for (let countString = 0; countString < searchString.length; countString++) {
                    const everyString = searchString[countString];
                    for (let count = 0; count < total; count++) {
                        if (everyString === tuplehanja[count] && !found) {
                            resultElement.innerHTML = '<div>漢字\t倉頡碼\t來源</div>';
                            resultElement.innerHTML += everyString + '\t' + tuplechanghil[count] + '\t' + tuplesource[count] + '<br>';
                            found = true;
                        } else if (everyString === tuplehanja[count]) {
                            resultElement.innerHTML += everyString + '\t' + tuplechanghil[count] + '\t' + tuplesource[count] + '<br>';
                            found = true;
                        } else if (count === total - 1 && !found) {
                            resultElement.innerHTML = '<div>查無此字</div>';
                        }
                    }
                }
            }
        }
